      <div className="user">
        <img src="https://images.pexels.com/photos/20787/pexels-photo.jpg?auto=compress&cs=tinysrgb&h=350" alt="" />
      <div className="info">
        <span>John</span>
        <p>Posted </p>
      </div>
      </div>  
      </div>
      <div className="menu">m</div>
    </div>
  );
};

export default Single;
